import React from "react";
import { Link } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1>Welcome!</h1>
      <p>This is our homepage!</p>
      <Link to="/login">
        <button
          style={{
            color: "red",
            padding: "5px",
          }}
        >
          Get Started
        </button>
      </Link>
    </div>
  );
}

export default Homepage;
